import './Login.css';
function Login() {
  return (
    <>
    <main>  
        <div class="left">
            <p class="logo">lulu school</p>
            <div class="form">
                <h3>Аккаунтқа кіру</h3>

                <input type="email" id="email" name="email" placeholder="Электрондық пошта: "/>
                
                <input type="password" id="password" name="pass" placeholder="Құпия сөз:"/>
                <br></br>
                <button>КІРУ</button>
                <p id="butW">Аккаунтыңыз жоқ па? <a  href={"signup.html"}>Тіркелу</a></p>
            </div>
        </div>
        <div class="right">
        </div>
    </main>

    </>
  );
}

export default Login;
